        return(

        <Grid centered>
          <Grid.Column textAlign='center'> 
            <Menu

            inverted
            fixed='left'
            vertical
            style={{ background: '#e7e7e7', top: '80px'}}

            >

            <Menu.Item name='Channels' as='h3' onClick={()=>console.log('err')} >

            </Menu.Item>

          </Menu>
          </Grid.Column>
        </Grid>

        )

    }
}

export default SidePanelLeft;
